function loadSeenOn(){const{seenOn:n}=seenOnList;n.forEach(((n,e)=>{const t=`<div class="carousel-item col-md-3${0==e?" active":""}">\n                                <div class="panel panel-default">\n                                    <div class="panel-thumbnail">\n                                        <a target="_blank" href="${n.link}" class="thumb">\n                                            <picture>\n                                                <source\n                                                    srcset="../img/events/${n.image}.webp"\n                                                    type="image/webp">\n                                                <source\n                                                    srcset="../img/events/${n.image}.png" \n                                                    type="image/png">\n                                                <img src="../img/events/${n.image}.png" alt="${n.title}" class="img-fluid mx-auto d-block">\n                                            </picture>\n                                        </a>\n                                    </div>\n                                </div>\n                            </div>`;document.getElementById("divEvents").innerHTML+=t}))}window.addEventListener("DOMContentLoaded",(n=>{let e=window.navigator.userLanguage||window.navigator.language,t="en-us/min";t=e.includes("es")?"es-sv/min":e.includes("zh")?"zh-zh/min":t;getScript(`../js/data/translations/${t}/seenOn.js`).then((()=>{loadSeenOn()})).catch((n=>{console.error(n)}))}));